import "../App.css";
const Header=()=>{
    return(
        <div className="header">
            <h1>Shortify</h1>
            <nav>
                <a href="#">Home</a>
                <a href="#">About us</a>
                <a href="#">Contact</a>
                <a href="#">Pricing</a>
                <a href="#"></a>
            </nav>
            <button>Click</button>
        </div>
    )
}
export default Header;
